import Typewriter from 'typewriter-effect';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function MainPage() {
    return (
        <>
            {/* <div className='px-4 py-5 my-5 text-center'> */}
            <div className='container'>
                <div className='row'>
                    <h1 className=' display-1 nameText csep' width='50'>Welcome!</h1>
                    <div className='col-md-4 fs-2 siteText'>
                        <Typewriter
                            onInit={(typewriter) => {
                                typewriter
                                    .typeString('My name is Adrian Dorado, avid doer of things.')
                                    .pauseFor(1000)
                                    .deleteAll()
                                    .typeString('Contact me @ doradocoding@gmail.com')
                                    .pauseFor(1000)
                                    .deleteAll()
                                    .typeString('I hope you enjoy your stay <3')
                                    .start()
                            }}
                        />
                    </div>
                </div>
                <div className='row'>
                    <div className='col-md'>
                        <img className='photomarg img-fluid' align='left' width='36%' src='./bun1.jpg' alt='no bun :(' />
                    </div>
                </div>
            </div>
        </>
    );
}
